import React from 'react';
import { BrowserRouter as Router, Route, Routes, Navigate, Link } from 'react-router-dom';
import LoginForm from './components/LoginForm';
import HomePage from './components/HomePage';
import ArticlesList from './components/ArticlesList';
import OrderForm from './components/OrderForm';
import OrderList from './components/OrderList';
import CustomersList from './components/CustomersList';
import NotFoundPage from './components/NotFoundPage';
import { useSelector } from 'react-redux';
import { selectToken } from './features/auth/authSlice';
const App = () => {

  const token = useSelector(selectToken);

  return (
    <Router>
      <div>
      <nav>
          {token && (
            <ul>
              <li><Link to="/articles">Articles List</Link></li>
              <li><Link to="/order-form">Order Form</Link></li>
              <li><Link to="/order-list">Order List</Link></li>
              <li><Link to="/customers-list">Customers List</Link></li>
            </ul>
          )}
        </nav>
        <Routes>
        <Route path="/login" element={!token ? <LoginForm /> : <Navigate to="/" replace />} />
        <Route path="/" element={token ? <HomePage /> : <Navigate to="/login" replace />} />
        <Route path="/articles" element={token ? <ArticlesList /> : <Navigate to="/login" />} />
        <Route path="*" element={<NotFoundPage />} />
      </Routes>
      </div>
    </Router>
  );
};

export default App;
